import React from 'react'
import {Link} from 'react-router-dom'

const Tea = () => {
    return(
    <>
        <h1>Get Tea</h1>
        <p>< Link to='/'>Go back to Vending Machine</Link></p> 
    </>
    )
}

export default Tea;
